import React  from "react";
import DeckList from "./DeckList"

function Home({decks, deckDesc }) {
        console.log(decks)
      const deck = deckDesc.map((deck) => (
          <DeckList deck={deck} key={deck.id} />
      ))
    return (
        <div>
                {deck}
        </div>
    )
}

export default Home
